var daysContainer=document.querySelector("#days"),hoursContainer=document.querySelector("#hours"),minutesContainer=document.querySelector("#minutes"),secondsContainer=document.querySelector("#seconds"),eventDate=new Date("Jan 8, 2023 07:00:00").getTime();function timer(){var e=(new Date).getTime(),t=eventDate-e;if(0<t){var n=Math.floor(t/864e5),o=Math.floor(t%864e5/36e5),r=Math.floor(t%36e5/6e4),a=Math.floor(t%6e4/1e3);daysContainer.textContent=9<n?n:"0"+n,hoursContainer.textContent=9<o?o:"0"+o,minutesContainer.textContent=9<r?r:"0"+r,secondsContainer.textContent=9<a?a:"0"+a}}timer();var inteval=setInterval(timer,1e3);